function Vids() {
	return (
		<section id='vids'>
			<div className='inner'>
				<h1>
					Upgrade Your
					<br />
					Product to
					<br />
					Amazing Thing
				</h1>
				<div className='wrap'></div>
			</div>
		</section>
	);
}

export default Vids;
